import {useState} from 'react';

import {Route, Routes, Switch, useHistory} from 'react-router-dom';
import Header from "./header/Header";
import Main from "./main/Main";


const App = () => {

    return (
        <Routes>
            <Route path='/' element={<Main/>}/>
        </Routes>
    );
}

export default App;


